import React from 'react'
import {Route,Routes} from 'react-router-dom';
import Product from '../components/Product/Product';
const Router = () => {
  return (
  
    <Routes>
    <Route path='api/product' element={<Product/>}/>
    </Routes>
  )
}

export default Router
